CREATE TABLE IF NOT EXISTS `feedback` (
  `id_feedback` int(11) NOT NULL AUTO_INCREMENT,
  `id_utilizador` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `data` date DEFAULT NULL,
  `hora` time DEFAULT NULL,
  `texto` text DEFAULT NULL,
  `status` tinyint(4) DEFAULT 0,
  PRIMARY KEY (`id_feedback`),
  KEY `id_utilizador` (`id_utilizador`),
  CONSTRAINT `feedback_ibfk_1` FOREIGN KEY (`id_utilizador`) REFERENCES `utilizadores` (`id_utilizador`)
) ENGINE=InnoDB AUTO_INCREMENT=228 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE IF NOT EXISTS `motivos` (
  `id_motivo` varchar(200) NOT NULL,
  `motivo_pedido` varchar(45) DEFAULT NULL,
  `materials_ico` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id_motivo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

CREATE TABLE IF NOT EXISTS `notas_alunos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `aluno_id` varchar(200) NOT NULL,
  `data_nota` date NOT NULL,
  `hora_nota` time NOT NULL,
  `nota` float NOT NULL,
  `motivo_nota` text DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `aluno_id` (`aluno_id`),
  CONSTRAINT `notas_alunos_ibfk_1` FOREIGN KEY (`aluno_id`) REFERENCES `utilizadores` (`id_utilizador`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=10684 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

CREATE TABLE IF NOT EXISTS `pedidos` (
  `id_pedido` varchar(200) NOT NULL,
  `hora_saida_pedido` time NOT NULL,
  `hora_entrada_pedido` time DEFAULT NULL,
  `data_pedido` date NOT NULL,
  `nome_pedido` varchar(45) NOT NULL,
  `status_pedido` enum('Bloqueado','Aguardando','Liberado','Negado') DEFAULT NULL,
  `motivo` varchar(150) DEFAULT NULL,
  `turmas_id_turma` varchar(200) NOT NULL,
  `utilizadores_id_utilizador` varchar(200) NOT NULL,
  PRIMARY KEY (`id_pedido`),
  KEY `fk_pedidos_turmas1_idx` (`turmas_id_turma`),
  KEY `fk_pedidos_utilizadores1_idx` (`utilizadores_id_utilizador`),
  CONSTRAINT `fk_pedidos_turmas1` FOREIGN KEY (`turmas_id_turma`) REFERENCES `turmas` (`id_turma`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pedidos_utilizadores1` FOREIGN KEY (`utilizadores_id_utilizador`) REFERENCES `utilizadores` (`id_utilizador`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

CREATE TABLE IF NOT EXISTS `turmas` (
  `id_turma` varchar(200) NOT NULL,
  `nome_turma` varchar(45) DEFAULT NULL,
  `cidade_turma` varchar(45) DEFAULT NULL,
  `periodo_turma` enum('Manhã','Tarde','Noite','Integral') DEFAULT NULL,
  PRIMARY KEY (`id_turma`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

CREATE TABLE IF NOT EXISTS `turmas_has_utilizadores` (
  `id_turmas_utilizadores` int(11) NOT NULL AUTO_INCREMENT,
  `turmas_id_turma` varchar(200) NOT NULL,
  `utilizadores_id_utilizador` varchar(200) NOT NULL,
  PRIMARY KEY (`id_turmas_utilizadores`),
  KEY `fk_turmas_has_utilizadores_utilizadores1_idx` (`utilizadores_id_utilizador`),
  KEY `fk_turmas_has_utilizadores_turmas_idx` (`turmas_id_turma`),
  CONSTRAINT `fk_turmas_has_utilizadores_turmas` FOREIGN KEY (`turmas_id_turma`) REFERENCES `turmas` (`id_turma`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_turmas_has_utilizadores_utilizadores1` FOREIGN KEY (`utilizadores_id_utilizador`) REFERENCES `utilizadores` (`id_utilizador`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=429 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

CREATE TABLE IF NOT EXISTS `utilizadores` (
  `id_utilizador` varchar(200) NOT NULL,
  `name_utilizador` varchar(45) NOT NULL,
  `init_name_utilizador` char(2) NOT NULL,
  `pass_utilizador` varchar(200) NOT NULL,
  `nivel_utilizador` enum('0','1','2') DEFAULT NULL,
  PRIMARY KEY (`id_utilizador`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;


